    constructor(props){
        super(props)
        this.state={
            username: 'in28minutes',
            password: ''
        }
    }
    render(){
        return(
        <div>
            Username: <input type="text" name="username" value={this.state.username} onChange={this.handler}/>
            Password: <input type="password" name="password" value={this.state.password}/>
            <button>Login</button>
        </div>
        )
    }
}

export default TodoApp;
